To customize the import specifiers used in JS, a --map configuration can be provided to the transpilation operation to convert the imports. For example, jco transpile component.wasm --map my:pkg/interface@1.2.3=./myinterface.js will instead output import { fn } from './myinterface.js'. Where the file myinterface.js would contain the function that is being imported from the interface: export function fn () { // .. function implementation ..
} Map configuration also supports # targets, which means that the interface can be read off of a nested JS object export. For example with a JS file written: export const interface = { fn () { // exported function to be imported from my:pkg/interface }
} We can map the interface directly to this object instead of the entire module using the map configuration: jco transpile component.wasm --map my:pkg/interface@1.2.3=./mypkg.js#interface This way a single JS file can define multiple interfaces together. Furthermore, wildcard mappings are also supported so that using (and quoting for bash compatibility): jco transpile component.wasm --map 'my:pkg/*@1.2.3=./mypkg.js#*' we can map all interfaces into a single JS file reading them off of exported objects for those interfaces.

