Here's an example of implementing a custom WIT interface in JavaScript: example.wit package test:pkg;
interface interface-types { type some-type = list<u32>; record some-record { some-field: some-type }
}
interface iface { use interface-types.{some-record}; interface-fn: func(%record: some-record) -> result<string, string>;
}
world myworld { import iface; export test: func() -> string;
} When transpiling, we can use the map rules as described in the previous section to implement all interfaces from a single JS file. Given a component compiled for this world, we could transpile it, but given this is only an example, we can use the --stub feature of transpile to inspect the bindings: jco transpile example.wit --stub -o output --map 'test:pkg/*=./imports.js#*' The output/example.js file contains the generated bindgen: import { iface } from './imports.js';
const { interfaceFn } = iface; // ... bindings ... function test () { // ...
} export { test } Therefore, we can implement this mapping of the world with the following JS file: imports.js export const iface = { interfaceFn (record) { return 'string'; }
}; Note: Top-level results are turned into JS exceptions, all other results are treated as tagged objects { tag: 'ok' | 'err', val }.

