Instantiation output is enabled via jco transpile component.wasm --instantiation sync|async. When using instantiation mode, the output is a JS module with a single instantiate() function. For async instantiation, the instantiate function takes the following signature: export async function instantiate( getCoreModule: (path: string) => Promise<WebAssembly.Module>, imports: { [importName: string]: any }, instantiateCore?: (module: WebAssembly.Module, imports: Record<string, any>) => Promise<WebAssembly.Instance>
): Promise<{ [exportName: string]: any }>; imports allows customizing the imports provided for instantiation. instantiateCore defaults to WebAssembly.instantiate. getCoreModule can typically be implemented as: export async function getCoreModule(path: string) { return await WebAssembly.compile(await readFile(new URL(`./${path}`, import.meta.url)));
} For synchronous instantiation, the instantiate function has the following signature: export function instantiate( getCoreModule: (path: string) => WebAssembly.Module, imports: { [importName: string]: any }, instantiateCore?: (module: WebAssembly.Module, imports: Record<string, any>) => WebAssembly.Instance
): Promise<{ [exportName: string]: any }>; Where instead of promises, all functions are synchronous.

