} The above JavaScript can now be executed in Node.js: $ node test.js Hello Wasm Components! \ ^__^ \ (oo)\______ (__)\ )/\ ||----w | || || Passing in the optional second parameter, we can change the cow: test.js import { cow } from './cowsay/cowsay.js'; console.log(cow.say('Hello Wasm Components!', 'owl')); $ node test.js Hello Wasm Components! ___ (o o) ( V )
